export default function Nav() {
  return (
    <nav className="pointer-events-none fixed bottom-6 z-20 flex w-full justify-center md:bottom-auto md:top-2 lg:left-8 lg:min-h-screen lg:flex-col" aria-label="Breadcrumb">
      <ol className="pointer-events-auto flex gap-2 overflow-hidden rounded-md bg-gray-50 px-2 shadow dark:bg-gray-800 md:px-0 lg:max-w-min lg:flex-col" role="list">
        <li></li>
      </ol>
    </nav>
  )
}
